import React from "react";
import styled from 'styled-components';
import { FaLinkedin, FaGithub } from 'react-icons/fa';
import { AiFillTwitterCircle, AiOutlineInstagram } from 'react-icons/ai';
import pinkBlock from "../images/bg-rec-1.png";
import orangeBlock from "../images/bg-rec-2.svg";
import headshot from "../images/headshot.svg";
import quotes from "../images/quotes.png"
import logo from "../images/logo.svg"

const Nav = () =>{
  return (
    <Container>
      <div className="wrapper">
        <nav>
          <div className="social-links">
             <FaLinkedin className="mx-4" style={{color: '#EDB462'}} size={22}/>
             <FaGithub className="mx-4" style={{color: '#EDB462'}} size={22}/>
             <AiFillTwitterCircle className="mx-4" style={{color: '#EDB462'}} size={22}/>
             <AiOutlineInstagram className="mx-4" style={{color: '#EDB462'}} size={22}/>
           </div>
           <div className="logo"><img src={logo} alt="logo" style={{width: '50px'}}/></div>
           <div className="menu-list">
             <ul>
               <li className="mx-4 font-bold">LATEST WORK</li>
               <li className="mx-4 font-bold">BLOG</li>
               <li className="mx-4 font-bold">HIRE ME</li>
             </ul>
           </div>
        </nav>
        <div className="images">
           <img src={headshot} alt="headshot" className="headshot"/>
           <img src={pinkBlock} alt="" className="pink-block"/>
           <img src={orangeBlock} alt="" className="orange-block"/>
           <img src={quotes} alt="" className="quotes"/>
           <div className="intro-block">
             <p className="first-line pb-2 font-light">Hi üëãüèæ I'm <span className="font-bold">Alanna</span>.</p>
             <p className="second-line  font-light">Software Engineer, Student, <br/>and Developer at WebstaurantStore.</p>
           </div>
         </div>
      </div>
    </Container>
  );
}

export default Nav;


const Container = styled.div`
  background: white;

  .wrapper {
    max-width: 1380px;
    margin: 0 auto;
    height: 720px;
    background: red;
  }

  .wrapper nav {
    display: flex;
    justify-content: space-around;
    padding-top: 2rem;
    z-index: 10;
  }

  .social-links {
    display: grid;
    place-items: center;
    display: flex;
  }

  .logo {
    z-index: 20;
  }

  .menu-list {
    display: grid;
    place-items: center;
  }

  .menu-list ul {
    display: flex
  }

  .images {
    position: relative;
    z-index: 0;
  }

  .headshot {
    z-index: 40;
    position: absolute;
    top: 4rem;
    left: 32rem;
    width: 32%;
  }

  .pink-block {
    z-index: 20;
    position: absolute;
    top: -8rem;
    left: 25rem;
    width: 30%;
    height: 30rem;
  }

  .orange-block {
    z-index: 10;
    position: absolute;
    left: 0;
    top: 5rem;
    width: 100%;
    height: 35rem;
  }

  .intro-block {
    background: #F3F5F9;
    padding-top: 20px;
    z-index: 50;
    position: absolute;
    left: 32rem;
    top: 25rem;
    width: 52%;
    height: 240px;
    padding-top: 50px;
  }

  .quotes {
    z-index: 60;
    position: absolute;
    left: 33.5rem;
    top: 27rem;
    width: 4%;
  }

  .first-line, .second-line {
    text-align: left;
    margin-left: 5rem;
    font-size: 1.8rem;
  }


`
